"Калі вы выключыце гэту функцыю, Памочнік не зможа паведамляць інфармацыю, якая тычыцца асабіста вас, на прыдатных прыладах, якія будуць дадавацца пазней у дом \"%1$s\".

Памочнік па-ранейшаму зможа дапамагаць вам:

• шукаць адказы ў інтэрнэце;

• атрымліваць мясцовую інфармацыю (напрыклад, пра надвор'е);

• прайграваць мультымедыйныя файлы і кіраваць прыладамі разумнага дома;

• заставацца ў добрым гуморы, слухаючы жарты, гуляючы ў гульні, а таксама ў іншых справах.

Змяніць выбраныя параметры заўсёды можна пазней у наладах Памочніка або праграмы Home."

"Дазвольце Памочніку Google паведамляць інфармацыю, якая тычыцца асабіста вас, на новых прыдатных прыладах, якія будуць дадавацца пазней у дом \"%1$s\".

Персанальныя вынікі залежаць ад тыпу прылады і могуць уключаць у сябе:

• каляндар, электронную пошту, фота, кантакты і напаміны;

• рэкамендацыі (напрыклад, відэа на YouTube);

• звесткі з падключаных прылад і сэрвісаў для адсочвання стану здароўя і фізічнай формы;

• персанальныя дзеянні (напрыклад, плацяжы і выклікі).

Змяніць выбраныя параметры заўсёды можна пазней у наладах Памочніка або праграмы Home."

"Персанальныя вынікі ўключаюць у сябе наступнае:

• даныя календара, электронную пошту, фота, кантакты і напаміны;

• рэкамендацыі (напрыклад, відэа на YouTube);

• звесткі з падключаных прылад і сэрвісаў для адсочвання стану здароўя і фізічнай формы;

• звесткі пра персанальныя дзеянні (напрыклад, пра плацяжы і выклікі).

Наладзіць або выключыць персанальныя вынікі заўсёды можна ў наладах Памочніка або праграмы Home.

Пры запыце персанальных вынікаў Памочнік будзе рэагаваць, калі распазнае ваш голас. Гэта значыць, што, калі ваш голас не будзе распазнаны, персанальныя вынікі паказвацца не будуць.

Персанальныя вынікі будуць паказвацца на гэтай прыладзе без запыту ад вас – на Галоўным экране і ў якасці апавяшчэнняў. На прыладах з уключанай функцыяй Face Match такія персанальныя вынікі паказваюцца, калі сістэма распазнае ваш твар. Хаця любы карыстальнік можа праглядаць гэтыя персанальныя вынікі, рэагаваць і націскаць на іх, вы можаце кіраваць паказам персанальных вынікаў праз налады Памочніка або праграмы Home.

Любы карыстальнік, які знаходзіцца перад прыладай, будзе бачыць вашы персаналізаваныя рэкамендацыі (напрыклад, рэкамендацыі YouTube)."

